import MainPage from "./components/MainPage";
import Rental from "./components/rental/Rental";
import React from "react";

function App() {
  return (
   <Routes>
      <Route path='/' element={<MainPage />}/>
     <Route path='/rental' element={<Rental/>}/>
      </Routes> 

  );
};

export default App;
